Stack-Queue/栈和队列常用算法总结.html.body:
如何用栈来实现队列，如何用队列来实现栈，如何用数组来实现栈和队列。

如何用栈实现队列
思路：用栈实现队列结构，准备两个栈，一个push栈，一个pop栈，加数据入push栈，取数据从pop栈中拿。总体思路是进push的数据倒入pop栈中，两次逆序等于顺序。倒的两个限制：（1） 如果push开始往pop中倒数据，一次要倒完 （2） pop栈为空才允许倒数据。只要满足以上两个限制，倒数据的行为可以发生在任何时刻
public static class twoStacksToQueue {
    private Stack pushStack;
    private Stack popStack;

    private void transfer() {
        if (!popStack.empty())
            return;
        while (!pushStack.empty()) {
            popStack.push(pushStack.pop());
        }
    }

    public twoStacksToQueue() {
        pushStack = new Stack<>();
        popStack = new Stack<>();
    }

    public boolean offer(int num) {
        pushStack.push(num);
        transfer();
        return true;
    }

    public int poll() {
        if (popStack.empty() && pushStack.empty()) {
            throw new RuntimeException("Queue is empty");
        }
        transfer();
        return popStack.pop();
    }

    public int peek() {
        if (popStack.empty() && pushStack.empty()) {
            throw new RuntimeException("Queue is empty");
        }
        transfer();
        return popStack.peek();
    }
}

如何用队列实现栈
思路：准备两个队列，一个data队列，一个help队列，压数的话压入data队列，弹出数将data队列中的数除了最后一个数之外其他的压入help队列，将最后一个数返回用户，再将data和help引用互换
public static class TwoQueuesToStack {
    private Queue data;
    private Queue help;

    public TwoQueuesToStack() {
        data = new LinkedList<>();
        help = new LinkedList<>();
    }

    public int push(int num) {
        data.add(num);
        return num;
    }

    public int pop() {
        if (data.isEmpty()) {
            throw new RuntimeException("Stack is empty");
        }
        while (data.size() > 1) {
            help.add(data.poll());
        }
        int res = data.poll();
        swap();
        return res;
    }

    public int peek() {
        if (data.isEmpty()) {
            throw new RuntimeException("Stack is empty");
        }
        while (data.size() > 1) {
            help.add(data.poll());
        }
        int res = data.poll();
        // 注意：最后一个数要加回help中
        help.add(res);
        swap();
        return res;
    }

    private void swap() {
        Queue tmp = data;
        data = help;
        help = tmp;
    }
}

如何用数组实现栈
思路：准备一个栈顶指针index，数组的大小设置为栈的大小为initSize。当要加一个数，index的含义为如果新来一个数，我把新来的数放在index位置。当用户让我弹出一个数，我弹出的数是index的前一个数（前一个数也就是位置处于index下面一个数，假设数组是竖直排列的，最底下是nums[0]）。index == size时前一个数下标为size - 1，栈满，如还要压入则给用户报错。index == 0时前一个数下标为-1。栈空，如还要弹出给用户报错。
public static class ArrayStack {
    private int[] array;
    private int index;
    public int size; // 栈的大小，也是数组的大小

    public ArrayStack(int initSize) {
        if (initSize  0) {
            return array[-- index];
        } else {
            throw new ArrayIndexOutOfBoundsException("The stack is empty!");
        }
    }

    public int peek() {
        if (index > 0) {
            return array[index - 1];
        } else {
            throw new ArrayIndexOutOfBoundsException("The stack is empty!");
        }
    }
}

